import React from 'react';
import { Grid } from '@material-ui/core';
import ImageSlider from 'components/Item/ItemOverview/ImageSlider';

const ItemsPage = () => {
  return (
    <React.Fragment>
      <Grid container spacing={0} justify="center">
        <Grid item md={2}></Grid>
        <Grid item md={5}>
          <ImageSlider />
        </Grid>
        <Grid item md={3}></Grid>
        <Grid item md={2}></Grid>
      </Grid>
    </React.Fragment>
  );
};

export default ItemsPage;
